import React from "react";
import "./pdf-viewer.css";

function PdfViewer({ pdfUrl }) {
    return(
        <div className="pdf-container">
            <iframe
            id="pdf"
            title="pdf"
            src={pdfUrl}
            width="100%"
            height="100%"
            >
            </iframe>
        </div>
    )
}

export default PdfViewer;
